// HasServices applies the HasEdge predicate on the "services" edge.
func HasServices() predicate.BronzeGCPAppEngineApplication {
	return predicate.BronzeGCPAppEngineApplication(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, ServicesTable, ServicesColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPAppEngineService
		step.Edge.Schema = schemaConfig.BronzeGCPAppEngineService
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasServicesWith applies the HasEdge predicate on the "services" edge with a given conditions (other predicates).
func HasServicesWith(preds ...predicate.BronzeGCPAppEngineService) predicate.BronzeGCPAppEngineApplication {
	return predicate.BronzeGCPAppEngineApplication(func(s *sql.Selector) {
		step := newServicesStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPAppEngineService
		step.Edge.Schema = schemaConfig.BronzeGCPAppEngineService
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

